import React from "react";

const SpecialProducts = () => {
  return (
    <div>
      <div className="">
        <h1>
          <span>This Week's </span>
          <span>Special Products</span>
        </h1>
        <p>
          Check out this week's special products that you can get with +20% OFF!
        </p>
      </div>
      <div>
        <a>Supplements</a>
        <a>Care</a>
        <a>Nutrition</a>
      </div>
    </div>
  );
};

export default SpecialProducts;
